LESSON : I get a lot of questions regarding foot technique and ways to improve speed & consistency. This is an exercise / groove that Ive been playing for a while now. Triplets with your right hand and foot - R K K, snare on 3 along with your left hand playing 4 on the hats. Try it out...it’s sick for getting your single foot down and also helps with your left hand speed and control. 
